import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import 'bootstrap-icons/font/bootstrap-icons.css';
import './Navbar.css'; // Stili specifici per la navbar

import logo from '../assets/logo.png'; // Assicurati che il percorso sia corretto

const NavbarComponent = () => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" className="navbar-custom">
      <Container fluid>
        <Navbar.Brand href="#">
          <img src={logo} alt="logo" className="navbar-logo" />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav className="ms-auto my-2 my-lg-0"> {/* Sposta i link a destra */}
            <Nav.Link href="#" className="fw-bold">Home</Nav.Link>
            <Nav.Link href="#" className="fw-bold">TV Shows</Nav.Link>
            <Nav.Link href="#" className="fw-bold">Movies</Nav.Link>
            <Nav.Link href="#" className="fw-bold">Recently Added</Nav.Link>
            <Nav.Link href="#" className="fw-bold">My List</Nav.Link>
          </Nav>
          <div className="d-flex align-items-center ms-4"> {/* Sposta gli icon a destra */}
            <i className="bi bi-search icons"></i>
            <div id="kids" className="fw-bold ms-2">KIDS</div>
            <i className="bi bi-bell icons ms-2"></i>
            <i className="bi bi-person-circle icons ms-2"></i>
          </div>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavbarComponent;
